import React, { Component } from "react";
import "./Credit.css";

class Credit extends Component {

    render() {
        return (
            <h6 className="credit-text">Copyright (c) 2011, The WebRTC project authors. All rights reserved.</h6>
        );
    }
}
export default Credit;
